import React from 'react';

export default function LoginRegister(){
    return(
        <div className="container">
            <div className="row">
                <div className="col-sm-6">
                    <h4>LOGIN TO ACCOUNT</h4>
                </div>
                <div className="col-sm-6">
                    <h4>OR  REGISTER IF YOU DON'T HAVE ONE</h4>
                </div>
            </div>

        </div>

    );
}
